import { Table } from 'antd';
import type { TableProps } from 'antd';
import { useSelector } from 'react-redux';
import { RootState } from '../Redux/store';

interface DataType {
  address: string;
  area: number;
  contain: number;
  table: number;
  sesion: number;
  day: number;
}

const columns: TableProps<DataType>['columns'] = [
  {
    title: 'Vị trí',
    dataIndex: 'address',
    rowScope: 'row',
  },
  {
    title: 'Diện tích',
    dataIndex: 'area',
    rowScope: 'row',
  },
  {
    title: 'Xếp theo kiểu rạp hát',
    dataIndex: 'area',
    rowScope: 'row',
  },
  {
    title: 'Home phone',
    colSpan: 2,
    dataIndex: 'tel',
    onCell: (_, index) => {
      if (index === 3) {
        return { rowSpan: 2 };
      }
      // These two are merged into above cell
      if (index === 4) {
        return { rowSpan: 0 };
      }
      if (index === 1) {
        return { colSpan: 0 };
      }

      return {};
    },
  },
];

